plot

Abby Jensen (Debby Ryan), who is eager to grow up, has been planning for her sweet 16 ever since she was a little girl. She has a list of secret wishes she wants to come true. When the big day finally arrives, she excitedly adds her 16th and final wish to the secret wish list she's been keeping - a photo of Logan (Keenan Tracy), her crush. Then begins the first of many unusual occurrences, each including visits from a peculiar woman, Celeste (Anna Mae Routledge). She first appears as an exterminator when the Jensen's house gets overrun by wasps from a nest in their attic that has been building up for 16 years. The Jensen family are now unable to go back into their house until the wasps are exterminated, however, Celeste manages to extract Abby's wish list from the house. Abby's best friend, Jay Kepler (Jean-Luc Bilodeau), appears and offers Abby a jacket to wear over her pajamas, as she is unable to go back into her house to change. When Abby reaches into Jay's jacket pocket, she finds a birthday present for her from Jay. It is a necklace with a half of a heart saying &quot;BFF&quot;. Jay has the other half which he uses as a charm on his key ring. As Jay and Abby go to their bus stop, a delivery truck pulls up, and Celeste comes out, dressed as a mail woman and gives a package to Abby. When Abby opens it, she discovers 16 candles and a matchbox.

